import React from 'react'
import Navbar from '../../component/navbar/navbar'
import Spin from '../../component/spin/spin'

const HomeSpin = () => {
  return (
    <div>
        <Navbar type="true"/>
        <Spin/>
    </div>
  )
}

export default HomeSpin
